import React, { Component } from 'react';
class Counter extends Component {
    state = {
        count : 1
    };

    render() { 
        return (
            <React.Fragment>
                <button onClick = {this.functionTest()}>{this.state.count}</button>
            </React.Fragment>
        );
    };
    functionTest() {
            this.state.count = this.state.count + 1
    };
};

 
export default Counter;
